import React, {Component, Fragment} from 'react';
import {Button, Col, Container, Nav, Navbar, Row} from "react-bootstrap";

class NavMenuDeskTop extends Component {
    render() {
        return (
            <Fragment>

                <Navbar fixed={"top"} className="navbar" bg="light">



                    <Container>
                        <Row>
                            <Col lg={4} md={4} sm={12} xs={12}>
                                <a href="btn"><img className="nav-logo" src="/images/logo.jpg"/></a>
                                <Button className="cart-btn"><i className="fa fa-shopping-cart"></i>4 items</Button>
                            </Col>

                            <Col lg={4} md={4} sm={12} xs={12}>
                                <div className="input-group w-100">
                                    <input type="text" className="form-control" aria-label="Text Input"/>
                                  <button type="button"  className="btn site-btn"><i className="fa fa-search"></i></button>
                                </div>
                            </Col>

                            <Col lg={4} md={4} sm={12} xs={12}>
                                <a href="" className="btn"><i className="fa h4 fa-heart"></i><sup><span className="badge bg-danger">4</span> </sup></a>
                                <a href="" className="btn"><i className="fa h4 fa-bell"></i><sup><span className="badge bg-danger">4</span> </sup></a>
                                <a href="" className="btn"><i className="fa-3x text-success fa  fa-mobile-alt"></i></a>
                                <a href="" className="h4 btn">LOGIN</a>
                            </Col>
                        </Row>
                    </Container>

                </Navbar>

            </Fragment>
        );
    }
}

export default NavMenuDeskTop;
